    <section>
        <form method="post" onSubmit={searchLeagues}>
          <input type="text" name="league" placeholder="Search league..." />
          <input type="submit" value="Search" />
        </form>
        <button onClick={realMadrid()}>TRYCK</button>
      {teams.map((team, i) => <div>{team.name}</div>)}
    </section>
  )
};

